ions in Lists |  | PythonCode |  |         0 |\r\n      | Applications of Array     |  | PythonCode |  |         0 |\r\n\r\n  @F1T2\r\n  Scenario Outline: The user clicks the Array topic links and runs the  invalid python code\r\n    Given The user is on the array page\r\n    When the user clicks the links from the array page under \"<Topics>\"\r\n    Then the user redirected to the clicked  link page in the array data structure\r\n    When the user clicks the try here button on the array page\r\n    Then the user is redirected to the Editor page with Run button in the array page\r\n    When the user clicks on run button after providing the invalid python code in array page from given sheetname \"<Sheetname>\" and rowno <Rownumber>\r\n    Then the user should be able to see a alertbox syntaxerror for the array page\r\n    And user navigate back and clicks the signout link in the array page\r\n    Then the user is logged out of the array and the dsalgoportal and the \"Logged out successfully\"  message is displayed\r\n\r\n    Examples: \r\n      | Topics                    |  | Sheetname  |  | Rownumber |\r\n      | Arrays in Python          |  | PythonCode |  |         1 |\r\n      | Arrays Using List         |  | PythonCode |  |         1 |\r\n      | Basic Operations in Lists |  | PythonCode |  |         1 |\r\n      | Applications of Array     |  | PythonCode |  |         1 |\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/gayathri/eclipse-workspace/ProjectDS/DSAlgoProject/src/test/resources/Features/Array.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Array","id":"6fe2578d-a3f8-4872-8dc9-d4d1d7c41495"}],"language":"en","keyword":"Feature","name":"F1 As a user I want to navigate to the Array home page","description":"  so that I can access its functionalities","children":[{"background":{"location":{"line":5,"column":3},"keyword":"Background","name":"","descript e message is displayed below the username textbox to the user \"Please fill out this field.\" \r\n\r\nWhen the user clicks the register button after enters the username with specialcharacter other than @/./+/-/_  as \"Testscripters###\"\r\nThen the user is not able to see the error message for username indicating the <\"invalid username\">\r\nThen the user will directed below the password textbox and the user able to see the message \" Please fill out this field.\" \r\n\r\nWhen the user clicks register button after entering the valid username and all numerical password as <\"Testscripers\"> and <\"123456789\">\r\nWhen the user clicks register button after entering the valid username and password lessthan 8characters as <\"Testscripers\"> and <\"Test12\">\r\nWhen the user clicks register button after entering the valid user name and commonly used password as <\"Testscripers\"> and <\"password\">\r\nThen the user is not able to see the error message indicating the <\"InvalidPassword\">\r\nThen the message is displayed below the password confirmation textbox as <\"Please fill out this field.\">\r\n\r\nWhen the user enters username,and different password in password and password confirmation as<\"Testscripers\"><\"Test@123456\"><\"Testuser12\">\r\nAnd clicks the register button\r\nThen the user gets the error message as \"password_mismatch:The two password fields didnt match.\"\r\n\r\nWhen the user clicks the link Register\r\nWhen the user clicks register button after entering all valid data as<\"TestScriptInnovators\"><\"test123456\"><\"test123456\">\r\nThen the user directed to the DSAlogo homepage and should be able see the  success message \r\n ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/gayathri/eclipse-workspace/ProjectDS/DSAlgoProject/src/test/resources/Features/DsalgoRegistrationpage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@UserRegistration","id":"f1021 s: \r\n      | Topics                |  | Sheetname  |  | Rownumber |\r\n      | Graph                 |  | PythonCode |  |         0 |\r\n      | Graph Representations |  | PythonCode |  |         0 |\r\n\r\n  @F6T2\r\n  Scenario Outline: The user clicks the Graph topic links and runs the  invalid python code\r\n    Given The user is on the graph page\r\n    When the user clicks the links from the graph page under \"<Topics>\"\r\n    Then the user redirected to the clicked  link page in the graph data structure\r\n    When the user clicks the try here button on the graph page\r\n    Then the user is redirected to the Editor page with Run button in the graph page\r\n    When the user clicks on run button after providing the invalid python code in graph page from given sheetname \"<Sheetname>\" and rowno <Rownumber>\r\n    Then the user should be able to see a alertbox syntaxerror for the graph page\r\n    And user navigate back and clicks the signout link in the graph page\r\n    Then the user is logged out of the graph and the dsalgoportal and the \"Logged out successfully\"  message is displayed\r\n\r\n    Examples: \r\n      | Topics                |  | Sheetname  |  | Rownumber |\r\n      | Graph                 |  | PythonCode |  |         1|\r\n      | Graph Representations |  | PythonCode |  |         1 |\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/gayathri/eclipse-workspace/ProjectDS/DSAlgoProject/src/test/resources/Features/Graph.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Graph","id":"5ae2f232-993e-4abf-8f69-2f42f3a1da14"}],"language":"en","keyword":"Feature","name":"F6 As a user I want to navigate to the Graph home page","description":"  so that I can access its functionalities","children":[{"background":{"location":{"line":5,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ged out successfully\"  message for the linked list page\r\n\r\nExamples:\r\n\r\n|Topics |                                      |Sheetname | |Rownumber|\r\n|Introduction |                                |pythonCode| |1|\r\n|Creating Linked LIst |                        |pythonCode| |1 |\r\n|Types of Linked List |                        |pythonCode| |1 |\r\n|Implement Linked List in Python |             |pythonCode| |1 |\r\n|Traversal |                                   |pythonCode| |1 |\r\n|Insertion |                                   |pythonCode| |1 |\r\n|Deletion  |                                   |pythonCode| |1 |   ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/gayathri/eclipse-workspace/ProjectDS/DSAlgoProject/src/test/resources/Features/Linked_List.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@LinkedList","id":"81247efa-9e20-4103-9f3b-17c5404ab8b7"}],"language":"en","keyword":"Feature","name":"F2 As a user I want to navigate to the Linked List home page","description":"  So that I can access its functionalities","children":[{"background":{"location":{"line":6,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":7,"column":1},"keyword":"Given ","keywordType":"Context","text":"User navigates to the login page","id":"260c0896-b966-4bbf-9337-09931cad091f"},{"location":{"line":8,"column":1},"keyword":"When ","keywordType":"Action","text":"User enters \"testscripters\" and \"test12345\"","id":"e9fa75a4-23a7-40a0-9566-ace21ba13306"},{"location":{"line":9,"column":1},"keyword":"And ","keywordType":"Conjunction","text":"Clicks the login button","id":"95cfb0fc-88fe-4afc-9e4a-b05c74d82b35"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"User should be logged in successfully","id":"3782b014-5b6f-4774-8312-ae22bff8a0af"}],"id":"f4260d2c-15a2-48db-bb61-72578eedd798"}},{"scenario":{"location":{"l ror for the queue page \r\nWhen The user navigate back and clicks the signout link in the queue page \r\nThen The user should be able to see the \"Logged out successfully\"  message for the queue data structure page\r\nExamples:\r\n\r\n|Topics |                                      |Sheetname | |Rownumber|\r\n|Implementation of Queue in Python|            |PythonCode| |1 |\r\n|Implementation using collections.deque |      |PythonCode| |1 |\r\n|Implementation using array |                  |PythonCode| |1 |\r\n|Queue Operations |                            |PythonCode| |1 |\r\n \r\n\r\n    \r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/gayathri/eclipse-workspace/ProjectDS/DSAlgoProject/src/test/resources/Features/Queue.feature","feature":{"location":{"line":4,"column":1},"tags":[{"location":{"line":3,"column":1},"name":"@Queue","id":"e502578a-aa4a-4408-985c-e3523cdff0a7"}],"language":"en","keyword":"Feature","name":"F3 As a Signedin User","description":" I want to navigate to the  Queue home page and have access to its functionalities","children":[{"background":{"location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":8,"column":1},"keyword":"Given ","keywordType":"Context","text":"User navigates to the login page","id":"17baf178-950b-4b50-b202-1200bba558b4"},{"location":{"line":9,"column":1},"keyword":"When ","keywordType":"Action","text":"User enters \"testscripters\" and \"test12345\"","id":"edd76d6c-567a-41cc-ace3-b0e3c3af4d2f"},{"location":{"line":10,"column":1},"keyword":"And ","keywordType":"Conjunction","text":"Clicks the login button","id":"aec70733-8a79-4d73-8c6a-e998d914b897"},{"location":{"line":11,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"User should be logged in successfully","id":"5db31711-62c0-4244-868a-13cb51665a00"}],"id":"a7890297-1ee4-497b-a685-b50f42e38913"}},{"scenario":{"location":{"line":14,"column":1},"tags":[{"location"
